import React,{useState,useEffect} from 'react';
import MaindishGrid from './MaindishGrid';
import Axios from 'axios';

function MainDish() {

    const [backendData, setBackendData] = useState([{}]);

    useEffect(()=>{
        fetch("/api/rawdata").then(
            response=> response.json()
        ).then(
            data => {
                setBackendData(data)
            }
        )
    },[])
   /*
