        setData(response.data);
      } catch (error) {
        console.error('Error fetching data:', error);
      }
    };
    */
  return(
   <>
    <div>
      <h1>Data from MySQL</h1>
      {(typeof backendData.users ==='undefined')?(<p>Loading...</p>):(
        backendData.users.map((user,index) =>(
            <p>{user}</p>
        ))
      )}
    </div>
   <MaindishGrid />;
   </>
  );
}

export default MainDish;
